"      Dickey RP, Thornton M, Nichols J, et al, &ldquo;Comparison of the Efficacy and Safety of a Highly Purified Human Follicle-Stimulating Hormone (Bravelle) and Recombinant Follitropin-Beta for",
"      <i>",
"       in vitro",
"      </i>",
"      Fertilization: A Prospective, Randomized Study,&rdquo;",
"      <i>",
"       Fertil Steril",
"      </i>",
"      , 2002, 77(6):1202-8.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?31/60/32708/abstract-text/12057729/pubmed\" id=\"12057729\" target=\"_blank\">",
"        12057729",
