var title_f31_60_32710="Lines of Blaschko";
var content_f31_60_32710=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F57219&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F57219&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 489px\">",
"   <div class=\"ttl\">",
"    Lines of Blaschko",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 469px; height: 576px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The pattern assumed by many different naevoid and acquired skin diseases on the human skin and mucosae. The cause of the pattern of Blaschko lines is unknown; they do not follow nerves, vessels, or lymphatics. The lines described by these conditions not only did not correspond to any known anatomical basis, but were remarkably consistent both from patient to patient and even from one disease to another. The lines may represent a clinical expression of a genetically programmed clone of altered cells, perhaps first expressed during embryogenesis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Med Art (www.med-ars.it). Copyright &copy; 2010.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
